Plot:

Celluloid is a 2013 Malayalam film written and directed by Kamal, starring Prithviraj, Mamta Mohandas and Chandni in the lead roles. The film is a biopic based on the life story of J.C. Daniel of Malayalam cinema,[2] the making of his film Vigathakumaran and the story of Vigathakumaran's heroine P. K. Rosie. The film is particularly based on the novel Nashta Naayika by Vinu Abraham and Life of J. C. Daniel, a biography of J. C. Daniel written by Chelangatt Gopalakrishnan.
